	('5e3b23294d4fc8245970594e', '5e3b23294d4fc8245970594e', 283, 'Home & Abroad', 4, 'Home life and travel experiences of young women in the 1920s and 2020s', '6cb59370-4864-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23294d4fc82459705956,5e3b23e04d4fc82459705970', '5e3b23294d4fc82459705956,10', '', '', '', '', '', '', '', '', '', '5e3d8f9c6b73eb0e7924f5d5'),
	('5e3b26b04d4fc824597059ac', '5e3b26b04d4fc824597059ac', 284, 'Living Situations', 4, 'Through our country\'s history, twentysomethings living at home has been the norm - it is the 1950s that is an outlier.', 'e6590fa0-4863-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23e04d4fc82459705970', '10', '', '', '', '', '', '', '', '', '', '5e3d8f936b73eb0e7924f5c4'),
	('5e3b2c944d4fc824597059fc', '5e3b2c944d4fc824597059fc', 285, 'Motherhood', 4, 'In the 1920s, women on average became mothers at the beginning of their 20s - now in the 2020s it is at the end.', '42d108f0-485f-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23e04d4fc82459705970', '10', '', '', '', '', '', '', '', '', '', '5e3d8f8c6b73eb0e7924f5b3'),
	('5e3b2fb44d4fc82459705a3d', '5e3b2fb44d4fc82459705a3d', 286, 'Travel', 4, 'The 1920s opened travel to many young women for the first time; in the 2020s, women relentlessly document their experiences.', 'd1c3f750-4861-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23e04d4fc82459705970', '10', '', '', '', '', '', '', '', '', '', '5e3d8f816b73eb0e7924f59b'),
	('5e3c317f4d4fc82459705d0f', '5e3c317f4d4fc82459705d0f', 287, 'Study Abroad', 4, 'The opportunity for young people to travel as part of their education has expanded since the 1920s, becoming a goal in reach of many today.', 'd0a84ee0-48f5-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23e04d4fc82459705970', '10', '', '', '', '', '', '', '', '', '', '5e3d8f766b73eb0e7924f583'),
	('5e3c3e034d4fc82459705d39', '5e3c3e034d4fc82459705d39', 288, 'The Sayonara Club', 4, 'Four young Lake Forest women worked their way across the country in 1920, causing a great stir back home.', '4df3cad0-48fd-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3b23e04d4fc82459705970', '10', '', '', '1920', '', '', '', '', '', '', '5e3d8f6b6b73eb0e7924f571'),
	('5e3c43924d4fc82459705d5a', '5e3c43924d4fc82459705d5a', 289, 'Independence', 4, 'Male authority dominated the lives of young 1920s women, from passports to purchases to property.', '9d788390-4900-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3c3f284d4fc82459705d49', '12', '', '', '', '', '', '', '', '', '', '5e3d8f616b73eb0e7924f560'),
	('5e3c51f34d4fc82459705edd', '5e3c51f34d4fc82459705edd', 290, 'The Tale of Two Socialites', 4, 'Edith Cummings and Ginevra King were girls born of wealthy Lake Forest families. Both were immortalized in The Great Gatsby as Jordan Baker and Daisy Buchanan (respectively). Their stories demonstrate the financial control men played in their lives.', '2d650570-4909-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3c3f284d4fc82459705d49', '12', '', '', '', '', '', '', '', '', '', '5e3dba666b73eb0e7924f67f'),
	('5e3c5d344d4fc82459705ef8', '5e3c5d344d4fc82459705ef8', 291, 'Passports', 4, 'In the 1920s, women traveled more widely than ever - but their legal documentation was still connected to the men in their lives.', 'e5532530-490f-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3c3f284d4fc82459705d49', '12', '', '', '', '', '', '', '', '', '', '5e3d8f366b73eb0e7924f536'),
	('5e3c62594d4fc82459705f10', '5e3c62594d4fc82459705f10', 292, 'Finances', 4, 'From holding a bank account to buying property, the ability for a young woman to use money â€“ and to navigate her own life â€“ was severely restricted in the 1920s. ', 'f4eb4600-4912-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3c3f284d4fc82459705d49', '12', '', '', '', '', '', '', '', '', '', '5e3d8f2f6b73eb0e7924f525'),
	('5e3c663c4d4fc82459705f28', '5e3c663c4d4fc82459705f28', 293, 'Education', 4, 'Young women in the 1920s and the 2020s could both claim to be part of the best educated generations in U.S. history. But this claim has shifted in meaning across the century.', '46c26fb0-4915-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3c663c4d4fc82459705f30,5e3d83cc6b73eb0e7924f46c', '5e3c663c4d4fc82459705f30,11', '', '', '', '', '', '', '', '', '', '5e3d840c6b73eb0e7924f4aa'),
	('5e3c6dd84d4fc82459705f55', '5e3c6dd84d4fc82459705f55', 294, 'Cost of Attendance', 4, 'Higher education has always had a financial barrier to attendance - but in the past 25 years, costs have risen astronmically.', 'd1864870-4919-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3d8f1f6b73eb0e7924f514'),
	('5e3c72b64d4fc82459705f7c', '5e3c72b64d4fc82459705f7c', 295, 'Lake Forest College, Then and Now', 4, 'Tuition and enrollment figures, 1920 and 2020, for Lake Forest College.', 'b6e34100-491c-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3d8f126b73eb0e7924f504'),
	('5e3c74f84d4fc82459705f8a', '5e3c74f84d4fc82459705f8a', 296, 'Marie M. Johnson', 4, 'Marie Johnson was a rarity in the 1920s - a female faculty member in the mathematics department.', '102e0780-491e-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3d8f0b6b73eb0e7924f4fb'),
	('5e3c776e4d4fc82459705f9f', '5e3c776e4d4fc82459705f9f', 297, 'Athletics', 4, 'The sporting experience for college women has exploded from phys ed and intramural only to thousands competing in intercollegiate athletics.', '86c93ad0-491f-11ea-aba7-1b48e92d690c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3db5946b73eb0e7924f66e'),
	('5e3d8ee56b73eb0e7924f4e1', '5e3d8ee56b73eb0e7924f4e1', 298, 'Public Voice & Professional Life', 4, 'From 1920 to 2020, women have gone from one fifth of the labor force to half.', '197b1370-49c6-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3d8ef06b73eb0e7924f4eb'),
	('5e3d92ae6b73eb0e7924f5fc', '5e3d92ae6b73eb0e7924f5fc', 299, 'Jobs for Women', 4, '', '59342d60-49c8-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3d92ae6b73eb0e7924f601'),
	('5e3da30d6b73eb0e7924f61b', '5e3da30d6b73eb0e7924f61b', 300, 'Irene Castle, Film Star, Dancer & Philanthropist', 4, 'Irene Castle was a famous ballroom dancer who came to live in Lake Forest later in life.', '19ea3280-49d2-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3da30d6b73eb0e7924f622'),
	('5e3da7246b73eb0e7924f636', '5e3da7246b73eb0e7924f636', 301, 'Katherine Robertson, City Clerk', 4, 'Katherine Robertson began working as a stenographer for the Lake Forest City Clerk in her 20s - and came to know the office so well she was selected for the position herself in 1939.', '8d21d300-49d4-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '5e3d83cc6b73eb0e7924f46c', '11', '', '', '', '', '', '', '', '', '', '5e3da9326b73eb0e7924f640'),
	('5e3dbce46b73eb0e7924f6a5', '5e3dbce46b73eb0e7924f6a5', 302, 'Leisure & Recreation', 4, 'From radio to smartphone, driving to Uber, movies to...movies - how young women spent their free time over the past century.', '84c36a90-49e1-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dbce46b73eb0e7924f6a9'),
	('5e3dbf6e6b73eb0e7924f6b3', '5e3dbf6e6b73eb0e7924f6b3', 303, 'Keeping Active', 4, 'The 1920s was a boom period for participatory sports in America â€“ athletic opportunities for women became widely available, rather than solely leisure pursuits of the wealthy. ', '61793a40-49e3-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dc0026b73eb0e7924f6d4'),
	('5e3dc3d66b73eb0e7924f6f4', '5e3dc3d66b73eb0e7924f6f4', 304, 'Going Out', 4, 'Where young women go - restaurants and clubs, parties and movie theaters - has changed less than how they get there.', 'a6f8e7d0-49e5-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dc3d66b73eb0e7924f6fa'),
	('5e3dc7de6b73eb0e7924f715', '5e3dc7de6b73eb0e7924f715', 305, 'Staying In', 4, 'Young women of both the 1920s and 2020s grew up with new technologies - radio and smartphones - transforming in-home connectivity.', '0cbee9a0-49e8-11ea-bd99-97c1ba3fab5c-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dc7de6b73eb0e7924f71a'),
	('5e3dcad558acea1b45990d69', '5e3dcad558acea1b45990d69', 306, 'Womanly Ideal', 4, 'Despite the rise of black actors and singers in the 1920s, the predominant image of beauty was white and thin. Diversity would take another 60 years to break through in fashion. ', 'd15556e0-49e9-11ea-94c0-511ce24f9fd8-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dcad558acea1b45990d6f'),
	('5e3dcc9e58acea1b45990d7a', '5e3dcc9e58acea1b45990d7a', 307, 'Instagram Face', 4, '', 'e530d8a0-49ea-11ea-94c0-511ce24f9fd8-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dcc9e58acea1b45990d7d'),
	('5e3dcfef58acea1b45990dd6', '5e3dcfef58acea1b45990dd6', 308, 'The Retailing of Beauty', 4, 'In the 1920s, manufactured cosmetics were still in their infancy.', 'ddefa100-49ec-11ea-94c0-511ce24f9fd8-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dcfef58acea1b45990ddb'),
	('5e3dd31458acea1b45990e28', '5e3dd31458acea1b45990e28', 309, 'The "Bob"', 4, 'The ubiquitous short hairstyle that ruled the 1920s has a Lake Forest connection.', 'bc4a2000-49ee-11ea-94c0-511ce24f9fd8-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dd31458acea1b45990e2e'),
	('5e3dd5f658acea1b45990e41', '5e3dd5f658acea1b45990e41', 310, 'Nails', 4, 'Painted nails, made popular in the late 1910s, moved into widespread practice in the 1920s with the development of lacquer paints. ', '52f4ce30-49f2-11ea-94c0-511ce24f9fd8-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5e3dd91458acea1b45990e84'),
