	('5f03d569b728ea72b3584df5', '5f03d569b728ea72b3584df5', 579, 'List of Speakers at Community Vigil in support of Black Lives Matter, 2020', 6, 'Document donated by Maddy Moore, listing the community members and others who spoke at the Community Vigil organized by Lake Forest & Lake Bluff Students & Alumni in support of Black Lives Matter. The vigil was held in aftermath of the killing of George Floyd, a Black man laying handcuffed on the ground, by Minneapolis police officers. Part of a global movement of protests against excessive use of force by police against black suspects, it was the largest civil rights protest in Lake Forest history, and the largest demonstration to take place in Lake Forest since at least the 1960s. ', 'd475b230-bff4-11ea-a44b-abad5b265d60-2500.jpeg', '', '5efe8b41448aeb5ec77eab68', '13', '3', '6', '2020', '', '', '', 'Market Square, Lake Forest, IL, USA', '', '', '5f03d6e0b728ea72b3584e1c'),
	('5f03d855b728ea72b3584e2e', '5f03d855b728ea72b3584e2e', 580, 'Drive through Lake Forest business district, June 3, 2020', 6, 'Boarded-up storefronts in the Lake Forest business district in advance of the Lake Forest & Lake Bluff Students & Alumni In Support Of Black Lives Matter Community Vigil. In the days leading to the event, social media outlets like Facebook featured community members voicing concern that the event could result in looting or property damage to local businesses. The gathering was peaceful and had no such incidents. ', '48b60590-bff6-11ea-a44b-abad5b265d60.jpg', '', '5f03d789b728ea72b3584e2c', '14', '3', '6', '2020', '', '', '', 'East Deerpath Road & Oakwood Avenue, Lake Forest, IL, USA', '', '', '5f03dd21b728ea72b3584e31'),
	('5f03e287b728ea72b3584e3d', '5f03e287b728ea72b3584e3d', 581, 'Interview with Maddy Moore, one of the organizers of the June 3, 2020 Lake Forest rally in support of Black Lives Matter', 6, 'Lake Forest High School graduate Maddy Moore and her sister Gabby were among the organizers of a successful, peaceful protest against racism in Lake Forest, IL on June 3rd, with the group Lake Forest & Lake Bluff Students & Alumni In Support Of Black Lives Matter. History Center staff member Alex Schneider conducted a Zoom interview with Maddy to talk about this historic rally.', 'https://img.youtube.com/vi/F-JnVJuTaKA/hqdefault.jpg', '', '5f03d143b728ea72b3584def,5f03d789b728ea72b3584e2c', '16,14', '5', '6', '2020', '', '', '', '', '', '', '5f03e287b728ea72b3584e3f'),
	('5f0fb388b4481c0d6c85312b', '5f0fb388b4481c0d6c85312b', 582, 'Lake Forest in 1920', 7, 'In 1920, Lake Forestâ€™s population was 3,600 and its land area 5.2 square miles (today: ~19,000 and 17 Â¼ square miles). Much of what we know as Lake Forest today - west of Green Bay Road - was not in the city limits yet. A large annexation in 1926 tripled the city in size.', '650d2440-c707-11ea-b340-7b89a9913531-2500.jpeg', '', '', '', '1', '1', '1920', '', '', '', '', '', '', '5f0fb96bb4481c0d6c853194'),
	('5f0fb4efb4481c0d6c853149', '5f0fb4efb4481c0d6c853149', 583, 'Lake Forest\'s public education budget, 1920', 7, 'In the Lake Forester newspaper, an article ran covering the Board of Education meeting, which detailed the education budget and the salaries of all the public school employees. (According to the CPI inflation calculator, $3,500 in 1920 has about the same buying power as $46,000 today, and $1,500 in 1920 as ~19,500 today.)  In 1920, Lake Forest was home to two public school buildings, Halsey School and Gorton School, which served K-8. (Students outside the city limits to the west attended Everett School or Vickerman School, out in the â€œcountry.â€)  ', '39066e50-c708-11ea-b340-7b89a9913531-2500.jpeg', '', '', '', '19', '3', '1920', '', '', '', '400 East Illinois Road, Lake Forest, IL, USA', '', '', '5f0fbeaab4481c0d6c8531bf'),
	('5f0fb838b4481c0d6c85317f', '5f0fb838b4481c0d6c85317f', 584, 'Spring cleaning', 7, 'The Lake Forester newspaper of late March, 1920 was rife with advertisements promoting products that would help with spring cleaning! Shelf paper and cleaning compounds, anyone?   Also pictured are the two businesses featured, the Anderson Brothers dry goods store at the corner of Deerpath and Western, and the grocer C.T. Gunn, located where Starbucks is today.', '290f7260-c70a-11ea-b340-7b89a9913531-2500.jpeg', '', '', '', '19', '3', '1920', '', '', '', 'East Deerpath Road & North Western Avenue, Lake Forest, IL, USA', '', '', '5f0fb838b4481c0d6c853184'),
	('5f0fbb96b4481c0d6c8531a4', '5f0fbb96b4481c0d6c8531a4', 585, 'Bead necklace made by Fort Sheridan soldier won in raffle', 7, 'In the years after WWI, nearly 20,000 returning wounded soldiers convalesced at Fort Sheridan, where staff sought to help them heal and readapt to civilian life through physical and occupational training (like stringing beads on necklaces).', '33830160-c70c-11ea-b340-7b89a9913531-2500.jpeg', '', '', '', '19', '3', '1920', '19', '3', '1920', 'Fort Sheridan, IL, USA', '', '', '5f0fbe8ab4481c0d6c8531b5'),
	('5f0fbddfb4481c0d6c8531af', '5f0fbddfb4481c0d6c8531af', 586, 'Lake Forest College debates becoming a women\'s school', 7, 'The hot debate at Lake Forest College was whether, amidst financial difficulties and moribund enrollments, it should transition to a womenâ€™s-only college, the â€œWellesley of the West.â€ This idea prompted vociferous objections from alumni, who proceeded to reformulate the board of trustees, pay down deficits, and hire a visionary new president, Herbert Moore. President Moore and his leadership team nearly doubled enrollment by 1926, harnessing the nationwide surge in high school graduates during the 1920s decade.', '8fea9840-c70d-11ea-b340-7b89a9913531-2500.jpeg', '', '', '', '26', '3', '1920', '', '', '', 'Lake Forest College, North Sheridan Road, Lake Forest, IL, USA', '', '', '5f0fbeb8b4481c0d6c8531cf'),
