	('5f8351e9c3c79114ca6fd765', '5f8351e9c3c79114ca6fd765', 637, 'No Justice No Peace', 8, 'Submitted by Carlos Cardona. Shot from the Black Lives Matter protest in Lake Forest, June 3, 2020', 'fff1c6b0-0b26-11eb-9393-9d12bd9f0fec-2500.jpeg', '', '5f14aa6e02eecf36938ebd20,5f14aa8b02eecf36938ebd21,5f52604d56c35d5ae23025aa', '21,22,20', '3', '6', '2020', '', '', '', 'Market Square, Lake Forest, IL, USA', '', '', '5f889257e6f9640433c35f33'),
	('5f835a68c3c79114ca6fd7af', '5f835a68c3c79114ca6fd7af', 638, 'Outdoor learning', 8, 'Submitted by Nini Lustig. Outdoor learning at Deer Path Middle School.', '7920b8a0-0bf6-11eb-9393-9d12bd9f0fec-2500.jpeg', '', '', '', '7', '10', '2020', '', '', '', 'Deer Path Middle School, Deerpath, Lake Forest, IL, USA', '', '', '5f835a68c3c79114ca6fd7b3'),
	('5f9b5dcd23407109bf085397', '5f9b5dcd23407109bf085397', 639, 'Cat Classmate', 8, 'Submitted by Kristine W. This year\'s first day of school pictures don\'t include a big yellow bus, or our friends and neighbors down the street. This year, during this global pandemic, choosing to go to 7th grade 100% remotely, this girl\'s only classmate this year is going to be Tux, this little black and white companion who is now entering 7th grade too!', '398d7f60-17eb-11eb-8ec7-2f4092d165c9-2500.jpeg', '', '5f14aa5e02eecf36938ebd1f', '19', '1', '9', '2020', '', '', '', 'Lake Bluff, IL, USA', '', '', '5f9b5edc23407109bf0853c7'),
	('5fabfe358281626724481dc4', '5fabfe358281626724481dc4', 640, 'When nature is your classroom', 8, 'Lake Bluff Middle School 8th grader Kate, facing school outdoors....in November!', '9e31aa90-242f-11eb-892e-29ef8a251a6c-2500.jpeg', '', '5f14aa5e02eecf36938ebd1f', '19', '9', '11', '2020', '', '', '', '', '', '', '5fabfe358281626724481dc8'),
	('5fac3dfc8281626724481e36', '5fac3dfc8281626724481e36', 641, 'Exhibiting the submissions: History Center Photo Contest 2020', 11, 'Lake Forest and Lake Bluff residents focus their lenses on a sense of self, sense of place, and sense of community. These photographs were all submitted to the History Center of Lake Forest-Lake Bluff\'s first-ever photo contest, running from August to October 2020. They will become part of our image archives, shedding light for future residents on our community and its people.', 'a2e55250-2455-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', '509 East Deerpath Road, Lake Forest, IL, USA', '', '', '5fc692bf82816267244847ba'),
	('5fac3f408281626724481e41', '5fac3f408281626724481e41', 642, 'Addington Leahy, 8-14, Sense of Community', 11, 'I chose this photo because it shows my friends on a beautiful morning having fun at our awesome beach. We all had to wake up so early to take it!', '623b4150-2456-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Beach, Lake Forest, IL, USA', '', '', '5fac41278281626724481eab'),
	('5fac3f818281626724481e4c', '5fac3f818281626724481e4c', 643, 'Addington Leahy, 8-14, Sense of Place', 11, 'I chose this photo because it shows Lake Forest\'s amazing beach with a beautiful sunset.', '89c4de20-2456-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Beach, Lake Forest, IL, USA', '', '', '5fac41318281626724481eb3'),
	('5fac40428281626724481e72', '5fac40428281626724481e72', 644, 'Alessandra Bisulca, 15-19, Sense of Place', 11, 'I live in Lake Bluff, IL, I am 15 years old and attend Lake Forest High School as a sophomore. I grew up always having photos taken of me (my momâ€™s friend is a photographer) and when I got older I decided I wanted to be on the other side of the camera. One of my favorite things about the town I live in is the ravine that runs through it. I often go there for a hike with my friends, family, dog, or even just by myself. I find that the ravine is very calming, and it is a place I go to to find serenity. On this day I took my dog down there and decided to take some photos while he explored around. I took many photos but this one is my favorite because I like how it gives off a calming vibe.', 'fd163310-2456-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Bluff, IL, USA', '', '', '5fac414c8281626724481ec3'),
	('5fac41ec8281626724481ede', '5fac41ec8281626724481ede', 645, 'Claire Jessen, 15-19, Sense of Community', 11, 'The beautiful Chicago skyline at nighttime never fails to impress. From the sunâ€™s afterglow behind the skyscrapers, to the reflecting streetlights on the crystal blue Lake Michigan, we are truly lucky to be so close to the most beautiful city in the country. The ombre faded sky emphasizes the beautiful John Hancock Tower silhouette, truly showing the beauty of the best city in the world.', '06504d20-2458-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Chicago, IL, USA', '', '', '5fac42808281626724481f08'),
	('5fac422a8281626724481ef2', '5fac422a8281626724481ef2', 646, 'Claire Jessen, 15-19, Sense of Community', 11, 'This was a photo from the Lake Forest Market Square Black Lives Matter protest in early June of 2020. The speaker, an amazing representative from the H.O.O.D. project, engaged the minds of hundreds of Lake Forest and Lake Bluff citizens as he told stories about all his organization has done and what still needs to be done. As pictured kneeled in front of a George Floyd painting, it symbolizes the strength of our community coming together to work towards a common goal of being the best and most equal society, no matter the color of our skin.', '20a2e340-2458-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Market Square, Lake Forest, IL, USA', '', '', '5fac427a8281626724481f00'),
	('5fac426a8281626724481efd', '5fac426a8281626724481efd', 647, 'Carly Kisselle, 15-19, Sense of Community', 11, 'For the History Contest photo I really wanted to explore one of my favorite styles of photography. I have always been super interested in portrait photography and between the three different themes I thought the theme community fit best. When I first was presented with the project I had a really difficult time choosing which theme. As I got to thinking I realized that I was going to visit my grandma the weekend before the due date. My grandmother is older and we took a lot of precautions because of the coronavirus. I was taking some pictures around her house and I caught a lot of shots of my mom helping out my grandma while wearing a mask. In these hard times I think that this picture shows the community of family.', '45d6d040-2458-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', '', '', '', '5fac426a8281626724481eff'),
	('5fac42b78281626724481f18', '5fac42b78281626724481f18', 648, 'Sheridan Leahy, 15-19, Sense of Place', 11, 'I chose this photo of the sunset at the beach because it reflects Lake Forestâ€™s beauty and peacefulness.', '74a5ff90-2458-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Beach, Lake Forest, IL, USA', '', '', '5fac42b78281626724481f1a'),
	('5fac42ea8281626724481f23', '5fac42ea8281626724481f23', 649, 'Sheridan Leahy, 15-19, Sense of Community', 11, 'I chose this photo of my friends because it really shows our loving, friendly community. I am so thankful to call Lake Forest my home.', '91eea430-2458-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fac42ea8281626724481f25'),
	('5fac44ae8281626724481f39', '5fac44ae8281626724481f39', 650, 'Rob Douglass, 20-64, Sense of Community', 11, 'Lake Bluff dog beach.', 'a03eeda0-2459-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Sunrise Park, Lake Bluff, IL, USA', '', '', '5fac44bd8281626724481f3c'),
	('5fac45248281626724481f4c', '5fac45248281626724481f4c', 651, 'Rob Douglass, 20-64, Sense of Place', 11, 'Crab Tree Farm', 'e6cfa7f0-2459-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Bluff, IL, USA', '', '', '5fac45248281626724481f4e'),
	('5fac456d8281626724481f57', '5fac456d8281626724481f57', 652, 'Hannah Judy Gretz, 20-64, Sense of Community', 11, 'I took this photo of a disembodied doll forearm and hand in the last days of February, on the brink of Covid isolation. It eerily presaged how we would soon be suddenly cutoff from physical community, the need to â€œreach outâ€ to family, friends, and neighbors to check on one another, and the establishment a new sense of virtual community.  I shot the photo along the Forest Park ring road, which became an even more treasured Lake Forest community locus for exercise, gazing at the lake, and waving distantly to others (from behind our masks).', '12328750-245a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Forest Park, Lake Road, Lake Forest, IL, USA', '', '', '5fac456d8281626724481f59'),
	('5fac45c28281626724481f5a', '5fac45c28281626724481f5a', 653, 'Brandon Harris, 20-64, Sense of Place', 11, 'Given the importance of our health care workers in 2020, I wanted to highlight an important part of our community, and that was the Lake Forest Hospital. From the early days of the pandemic when the North Shore communities were seeing large numbers of cases to the resurgence of the virus in late summer, the dedicated medical staff have worked tirelessly to save lives and to care for our families. The hospitalâ€™s visually stunning architecture speaks not only to the quality of the building itself, but to the proficiency, expertise and the generosity of spirit of the medical staff within.', '86b3a9b0-245a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Hospital, North Westmoreland Road, Lake Forest, IL, USA', '', '', '5fac46308281626724481f65'),
	('5fac46878281626724481f78', '5fac46878281626724481f78', 654, 'Teresa Chung Hutchinson, 20-64, Sense of Place', 11, 'After months spent indoors, the Lake Forest beach finally opened on May 23, 2020 and we headed outside!  It was too cold to swim, so we attempted the next best option - dancing!  It was the perfect day to get outside and appreciate the beautiful scenery.', 'b97d3820-245a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Beach, Lake Forest, IL, USA', '', '', '5fac46878281626724481f7a'),
	('5fac46d38281626724481f95', '5fac46d38281626724481f95', 655, 'Sean Leahy, 20-64, Sense of Place', 11, 'I selected this photo because it highlights Lake Forest\'s architecture, beauty, and design.', 'e6e0a270-245a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Market Square, Lake Forest, IL, USA', '', '', '5fac46d38281626724481f97'),
	('5fac471d8281626724481fa0', '5fac471d8281626724481fa0', 656, 'Sean Leahy, 20-64, Sense of Community', 11, 'I chose this photo because it shows our beautiful daughters in our backyard on a gorgeous Lake Forest summer day.', '1241d420-245b-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fac471d8281626724481fa2'),
	('5fac474f8281626724481fab', '5fac474f8281626724481fab', 657, 'Kate Murray, 20-64, Sense of Place', 11, '', '31b12950-245b-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Sunrise Park, Lake Bluff, IL, USA', '', '', '5fac474f8281626724481fad'),
	('5fac47a28281626724481fb6', '5fac47a28281626724481fb6', 658, 'Amy Parsky, 20-64, Sense of Place', 11, 'Lake Forest is a very special place of community of people. The photo was taken on 7/28/16 at East Lake Forest train station where my son and his friend were on their way to Lollapalooza in downtown Chicago.  As the boys were walking away, I can sense their excitement of unknown.  This photo was also used in the final shot of the 2016-2017 LFHS Boys Varsity Basketball Team Book where Thoreau quote (Go confidently in the direction of your dreams! Live the life youâ€™ve imagined.)  was used to send off the graduating seniors.', '627f35e0-245b-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Metra Station Union Pacific, East Deerpath Road, Lake Forest, IL, USA', '', '', '5fac47a28281626724481fb8'),
	('5fac47fe8281626724481fc1', '5fac47fe8281626724481fc1', 659, 'Ellen Stelter, 20-64, Sense of Community', 11, 'Nothinâ€™ says Summer like a dip in the neighborâ€™s pool,  In the Dog-Dayâ€™s-of-Summer... these pups definitely rule!', '99a7d8b0-245b-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fac47fe8281626724481fc3'),
	('5fac498f8281626724481fe2', '5fac498f8281626724481fe2', 660, 'Steve Amidei, 65+, Sense of Place', 11, 'The Douglas Estate, where me and my three sisters lived. This was the first place where the three wheel leaf blower was tried out. I ask my dad about this and he told me that there were four other estates being used for this machine. This blower saved us time, whereas before it took about two days to do the leaves, now it just took a day and a half. Dad was gardener, handyman, security and chauffeur. Since there were bushes with flowers, he would do the crown for Mary at St. Maryâ€™s. This went on for a long time.', '88e34900-245c-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Green Bay Road, Lake Forest, IL, USA', '', '', '5fac498f8281626724481fe4'),
	('5fac49c68281626724481fed', '5fac49c68281626724481fed', 661, 'Carl Behr, 65+, Sense of Place', 11, 'As a 94 year old amateur photographer taken to walks among our open lands savannas and woods where wild weeds provide washes of color, I dare not compare with the lushness of our Northshore professional landscapers and gardeners. Instead, I preserve a splash of Fallâ€™s color in my small condo with a dash of fun thrown in.', 'a9b16ae0-245c-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fac49c68281626724481fef'),
	('5fac4ad9828162672448200e', '5fac4ad9828162672448200e', 662, 'Linda Garrison, 65+, Sense of Place', 11, 'Sunset Solitude   While I enjoyed an evening dinner in Lake Villa, the colors of the sunset and the quiet of the lone fisherman captured my thoughts.', '4d7f9f20-245d-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Villa, IL, USA', '', '', '5fac4ad98281626724482010'),
	('5fac4b378281626724482024', '5fac4b378281626724482024', 663, 'Terry McKinnon, 65+, Sense of Place', 11, 'March, Lake Forest Beach', '85813cd0-245d-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fac4b378281626724482026'),
	('5fac4bb8828162672448202f', '5fac4bb8828162672448202f', 664, 'Exhibiting the Submissions: History Center Photo Contest', 11, 'Lake Forest and Lake Bluff residents focus their lenses on a sense of self, sense of place, and sense of community. These photographs were all submitted to the History Center of Lake Forest-Lake Bluff\'s first-ever photo contest, running from August to October 2020. They will become part of our image archives, shedding light for future residents on our community and its people.', 'd15d4040-245d-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fc692a082816267244847b0'),
	('5fad644d8281626724482165', '5fad644d8281626724482165', 665, 'Addington Leahy, 8-14, Sense of Self', 11, '"I chose this selfie because it shows me when I am happy and feeling my best."', '0e360ea0-2505-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fad644d8281626724482169'),
	('5fad65708281626724482183', '5fad65708281626724482183', 666, 'Maria Diaz, 15-19, Sense of Self', 11, 'I love taking pictures and I strive to take unique and interesting pictures. Ever since I took photography in freshman year I started to get into photography. I bought a camera and took pictures whenever I could. I also started to explore photographers and learn techniques. In sophomore year I once again took photography class and right now as a junior I am taking photography for the third time. During my process of taking this picture I thought about how I could lead the viewer to the focal point which was my model. That is when I decided to take the picture through the chains of the park\'s swing. I wanted to display a theme of an adult stuck and unable to move forward. To keep the image mysterious I edited it in black and white. I like to challenge myself to take distinctive pictures.', 'babe7400-2505-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fad65708281626724482187'),
	('5fad6a5482816267244821c5', '5fad6a5482816267244821c5', 667, 'Natalie Goeks, 15-19, Sense of Place', 11, 'This image displays a theme of sense of place, showing a graffiti art bus at Power Waukegan, an entertainment facility. A person wearing a mask walks along the bus, a connection to the position of the world today. During the photo shoot in which this image was taken, I met some of the staff of Power Waukegan. They were extraordinarily kind, allowing me to take pictures and going out of their way to help me. This center has built a community whose vibrancy can be seen through the colorful art on the bus. The community of staff is supportive and inclusive, building a friendly environment. The building Power Waukegan is located in has walls covered in beautiful graffiti art of many different styles which reflects the individuality of the artists. This photo is a snapshot of a fantastic place in the world today. ', 'a596ed70-2508-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Power Waukegan, Belvidere Road, Waukegan, IL, USA', '', '', '5fad6a5482816267244821c9'),
	('5fad6ac282816267244821d3', '5fad6ac282816267244821d3', 668, 'Peter Elliott, 15-19, Sense of Community', 11, 'If only because it felt like all of Lake Forest was there, this photo feels like it requires little context.  Taken at the Black Lives Matter rally held in June 2020 at Market Square, this portrait of our community captures our current moment of pandemic, unity, and change.  As a journalist for The Forest Scout, Lake Forest High Schoolâ€™s student newspaper, I am always seeking out stories that are engaging, thought-provoking, and relevant to our readers. I have covered all kinds of local events, from school board meetings to football games, but the rally was a wholly different experience.  I expected a sizable crowd, but I never anticipated a turnout so massive that it would end up being the largest public protest in Lake Forest history.  Iâ€™ll never forget the day when Lake Forest united for the cause of racial justice, and pledged to listen, act, and lead.', 'e98d9bf0-2508-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Market Square, Lake Forest, IL, USA', '', '', '5fad6ac282816267244821d6'),
	('5fad6b6782816267244821e8', '5fad6b6782816267244821e8', 669, 'Ellen Stelter, 20-64, Sense of Self', 11, 'â€œA Time for Reflection...â€ During these claustrophobic Covid moments of life, I am so very blessed to be able to enjoy sunrise walks in the Middlefork Savanna.After having rather a rough start to the new year, that of being held at gunpoint during an attempted armed robbery at a local store in January; losing my mother in February to cancer, then March comes roaring in like a lion with Covid-19... Life was looking pretty bleak.  Counting my blessings and being forever thankful, thankful for family and the beauty that surrounds me each and every day.  I found myself able to capture this peaceful sunrise moment with my â€œPoppy â€œ in the Middlefork Savanna.', '4a47b980-2509-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Middlefork Savanna Forest Preserve, Middlefork Drive, Lake Forest, IL, USA', '', '', '5fad6b6782816267244821ec'),
	('5fad6c518281626724482214', '5fad6c518281626724482214', 670, 'Karyn Szaflarski, 20-64, Sense of Place', 11, 'The title of my photograph is Which Way? This photo was taken in 2007 while I was a student at DePaul University and enrolled in a Digital Photography course. I snapped hundreds of photos striving for the perfect shot taking into consideration what I learned about photography throughout the quarter, and Which Way? was it. The photograph was taken at Forest Park Beach, Lake Forest, Illinois.  The wooden boardwalk winding down to the beach was my favorite place to walk at the lakefront. This photo is more meaningful today because due to erosion at the beach the boardwalk is no longer intact.   Iâ€™m so glad to have documented the boardwalk in photography.   The photo expresses the unknown. The viewer has a limited view down both paths creating mystery for what lies in wait.  The black and white shadows add to the mystery. Which way should I choose to go?', 'd4e25c30-2509-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Forest Park, Lake Road, Lake Forest, IL, USA', '', '', '5fad6c518281626724482218'),
	('5fad6cbc828162672448222a', '5fad6cbc828162672448222a', 671, 'Diane DiVagno, 20-64, Sense of Community', 11, 'On May 30, 2020 many in our HO Stone neighborhood in Lake Forest came together to celebrate the 100th birthday of our resident hero, Donald Murray a World War II veteran fighter pilot and POW and now a centenarian to boot! Given his age and the fact that we are in the midst of a pandemic, a parade was organized with many from our neighborhood participating especially children. It was a beautiful celebration which truly made me feel lucky to live in such a wonderful close-knit community. Sadly, Mr. Murray passed away recently. I am grateful that we came together on that day to honor him with a well-deserved celebration. RIP Mr. Murray.', '1584fdb0-250a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fad6cbc828162672448222e'),
	('5fad6d418281626724482265', '5fad6d418281626724482265', 672, 'Linda Garrison, 65+, Sense of Self', 11, 'Fair Maiden in the Mirror I have always had a passion for mirrors, especially unique mirrors with a story to tell.  Although this mirror didn\'t share, I imagined her past images.', '63f8ea10-250a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '5fad6d418281626724482269'),
	('5fad6df68281626724482291', '5fad6df68281626724482291', 673, 'Calvin Gage, 65+, Sense of Place', 11, 'Cal Gage is a long-time Lake Bluffer, a nonagenarian, and -- every May -- a supplier of fresh oranges for the Baltimore Orioles attracted to his backyard feeding stations.', 'd0be5f90-250a-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Bluff, IL, USA', '', '', '5fad6df68281626724482295'),
	('5fad6eb082816267244822aa', '5fad6eb082816267244822aa', 674, 'Linda Garrison, 65+, Sense of Community', 11, 'High in the Chicago Sky      Go to all heights to view our beautiful city as birds can experience it daily.  I left my fears at home and walked in my courageous shoes, one footstep at a time', '40b761c0-250b-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Chicago, IL, USA', '', '', '5fad6ede82816267244822b7'),
	('5fad761782816267244822dc', '5fad761782816267244822dc', 675, 'Claire Jessen, 15-19, Self', 11, 'Claire Jessen, Self This is a portrait from a beautiful Lake Michigan sunrise that highlights the beauty of a silhouette. The sun catches her hair so perfectly and almost appears to be on fire as it illuminates every strand and every detail. The sun highlights every one of her amazing features, and captures every pixel of her outline, hence her sense of self.', 'a9fba2f0-250f-11eb-892e-29ef8a251a6c-2500.jpeg', '', '', '', '', '', '', '', '', '', 'Lake Forest Beach, Lake Forest, IL, USA', '', '', '5fad761782816267244822de'),
