	('60d63a21b6a3a2001764d745', '60d63a21b6a3a2001764d745', 810, 'Map Stories: The Hidden History in the Maps of Lake Forest and Lake Bluff', 14, 'People have created maps for more than 15 000 years. The very first maps were of the stars on the cave walls of early man. In a land lit only by fire, the stars of the night sky had a visibility that few of us will ever have the advantage to see.', '4c69c210-de88-11eb-8309-6526772ed0c2-2500.jpeg', '', '60d63205b6a3a2001764d6d2', '27', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '61e1b837f7f5b2001821aa1d'),
	('60dccebd80a7d50017122758', '60dccebd80a7d50017122758', 811, 'City Planning: Balancing Nature and Need', 14, 'It is one of the dilemmas of settling land: People move to a place because of the natural beauty, the quality of the land, and the proximity to natural features like rivers and lakes. And the first thing we do when we settle the land is change it, by building and paving and altering the natural environment.', '9ee42110-d9de-11eb-9243-99aa276b486d-2500.jpeg', '', '60dccebd65ade40017fdd5aa', '24', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '60de142febd2c30017d2aa0e'),
	('60dcd8cf65ade40017fdd5e3', '60dcd8cf65ade40017fdd5e3', 812, 'Passing Through and Settling In', 14, 'Maps are built from the stories of people, their stops and starts, migrations and habitations, the communities they create and their intersections with each other. Maps can make our local stories come to life - if you know where to look.', 'a0a80970-d9e4-11eb-9243-99aa276b486d-2500.jpeg', '', '60dcd8cf65ade40017fdd5ec', '26', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '60de14417bfff10017a340c7'),
	('60dcdb2f65ade40017fdd605', '60dcdb2f65ade40017fdd605', 813, 'Mapping the Shifting Sands', 14, 'Beyond the built world are maps that focus on the land itself. Geologic surveying of the US officially began with the United States Geological Survey (USGS) department in 1879, but surveyors had been working since the 1700s informally, as the land was being traversed for minerals, furs, and other natural resources.', '0aea12f0-d9e6-11eb-ac78-4ddfb4ca97e1-2500.jpeg', '', '60dcdb2f80a7d50017122787', '25', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '60de1457ebd2c30017d2aa25'),
	('60dde0087bfff10017a33f12', '60dde0087bfff10017a33f12', 814, 'Marketing Through Maps', 14, 'The lines and dots and names written on a map give structure to the land and its built environment. But a mapâ€™s prospects can also help define a communityâ€™s character. The role maps play goes far beyond mere description - they are human interpretations of our world, made by creators with individual points of view, and aimed at specific audiences. ', '849bee20-da81-11eb-a664-6535e38e1747-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '', '', '', '', 'Lake Bluff, IL, USA', '', '', '60de1540ebd2c30017d2aa3c'),
	('60dde746ebd2c30017d2a830', '60dde746ebd2c30017d2a830', 815, 'Getting on the Map', 14, 'In 1924 the US adopted and developed a numbering system, which was designed to standardize signage and labeling of the state highways. Up until then, names were used to describe routes, many of which remain today.', '51ff5460-da87-11eb-a664-6535e38e1747-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '', '', '', '', 'Lake Forest, IL, USA', '', '', '60de1552ebd2c30017d2aa4c'),
	('60ddf5f57bfff10017a33fd8', '60ddf5f57bfff10017a33fd8', 816, 'The Plan of Lake Forest', 14, 'In 1856, the trustees of the Lake Forest Association discussed hiring landscape architect Almerin Hotchkiss (1816-1903) to create a plan for Lake Forest. Embedded in his selection was the decision to have the design diverge from the grid layout of Chicago, except for the small merchant quarter.', '8f014b50-da8e-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60d63205b6a3a2001764d6d2', '27', '', '', '1857', '', '', '', 'Lake Forest, IL, USA', '', '', '60de1566ebd2c30017d2aa63'),
	('60ddfa127bfff10017a34007', '60ddfa127bfff10017a34007', 817, 'Home Owners\' Loan Corporation Map, 1937', 14, 'Careful examination of maps reveals absence as well as presence, and can help fill in gaps in the narrative of history. People of color have been a vital force in the community of Lake Forest since its earliest days. However, through much of the 19th and 20th centuries, they were directed and expected to dwell only in certain neighborhoods - whether implicitly or explicitly. Residents of Jewish descent often could acquire property only on the periphery. Other surrounding communities also confront a similar legacy of redlining, restrictive covenants, or â€œgentlemanâ€™s agreementsâ€ not to sell to certain populations.', '0689f670-da91-11eb-a664-6535e38e1747-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '1937', '', '', '', 'Lake Forest, IL, USA', '', '', '60de16f9ebd2c30017d2aa7f'),
	('60ddfe50ebd2c30017d2a8c6', '60ddfe50ebd2c30017d2a8c6', 818, 'Map of Lake County, Illinois, 1873', 14, 'This map was originally engraved by Gaylord Sangston Truesdell (1850-1899), a Waukegan native who began his career as an engraver. He went on to study art in Paris and became a well-regarded painter, particularly known for pastoral subjects.', '936aa6a0-da93-11eb-a664-6535e38e1747-2500.jpeg', '', '60d63205b6a3a2001764d6d2', '27', '', '', '1873', '', '', '', 'Lake Forest, IL, USA', '', '', '60de17097bfff10017a340e6'),
	('60de04197bfff10017a34029', '60de04197bfff10017a34029', 819, 'Lake Forest, c. 1885.', 14, '', '04557b80-da97-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60d63205b6a3a2001764d6d2', '27', '', '', '1885', '', '', '', 'Lake Forest, IL, USA', '', '', '60de1718ebd2c30017d2aaa4'),
	('60de061aebd2c30017d2a914', '60de061aebd2c30017d2a914', 820, 'A Map of the City of Lake Forest and Environs, 1971', 14, 'This fascinating map provides a high level of detail, featuring the outlines of significant community structures like schools, churches, clubhouses and civic buildings in addition to the expected streets, train lines, landforms and waterways. The dominant element is the dozens of subdivision names, labeling the land across lot lines. ', '35bc9e50-da98-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60d63205b6a3a2001764d6d2', '27', '', '', '1971', '', '', '', 'Lake Forest, IL, USA', '', '', '60de172eebd2c30017d2aaad'),
	('60de0a92ebd2c30017d2a9bb', '60de0a92ebd2c30017d2a9bb', 821, 'Map of Lake County, Illinois, 1861', 14, 'This 1861 wall map provides one of the first comprehensive snapshots of Lake County, which was formed in 1839 from part of McHenry County.* By this period, lithography had supplanted copperplate engraving to transform the map-making process, rendering maps like this one accessible to local audiences: government officials, land agents, merchants, prospective residents. ', 'da218260-da9a-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dcd8cf65ade40017fdd5ec', '26', '', '', '1861', '', '', '', 'Lake Forest, IL, USA', '', '', '60de173e7bfff10017a340f6'),
	('60de0c10ebd2c30017d2a9d2', '60de0c10ebd2c30017d2a9d2', 822, 'A Map of the City of Lake Forest and Environs, 1960, showing property annexations, 1894-1957', 14, 'This map, donated to the History Center with other City archives, has been color-coded to show how the City of Lake Forest had grown over time through property annexation. By 1960, the area of Lake Forest had quintupled from its original footprint, from 3 square miles to 15. ', 'c04649b0-da9b-11eb-a664-6535e38e1747-2500.jpeg', '', '60dcd8cf65ade40017fdd5ec', '26', '', '', '1960', '', '', '', 'Lake Forest, IL, USA', '', '', '60de174f7bfff10017a34106'),
	('60de0d617bfff10017a34095', '60de0d617bfff10017a34095', 823, 'Map of stations in Lake Forest and Lake Bluff, Chicago, North Shore and Milwaukee Railroad, 1963', 14, 'The Chicago, North Shore and Milwaukee Railroad, known as the North Shore Line, was an electric interurban railway between Chicago and Milwaukee. Construction began through Waukegan in 1895. Interurban railways made more frequent stops and were usually less expensive than railroad lines such as the Chicago and North Western. This made them ideal for shorter trips to a greater variety of destinations.', '8cb11160-da9c-11eb-a664-6535e38e1747-2500.jpeg', '', '60dcd8cf65ade40017fdd5ec', '26', '', '', '1963', '', '', '', 'Lake Forest, IL, USA', '', '', '60de17607bfff10017a3410f'),
	('60de0e237bfff10017a340a3', '60de0e237bfff10017a340a3', 824, 'Tax parcel map, Southwest quarter of section 34, Shields Township', 14, 'The Sidwell Company, based in St. Charles, Illinois, has been known for maps like this tax parcel map since it was founded in 1927. Here you can see parcel numbers and lot dimensions, as well as street and subdivision names.', '023d6230-da9d-11eb-a664-6535e38e1747-2500.jpeg', '', '60dcd8cf65ade40017fdd5ec', '26', '', '', '1970', '', '', '', 'Lake Forest, IL, USA', '', '', '60de176c7bfff10017a3411f'),
	('60de1085ebd2c30017d2aa00', '60de1085ebd2c30017d2aa00', 825, 'All Roads Lead to Ferry Hall, 1932', 14, 'This map was hand-drawn by Sarah Allen Liddle, an art teacher at Ferry Hall who had studied at the Art Institute in Chicago and the School of Industrial Art and Academy of Fine Arts in Philadelphia. A promotional piece, it dispenses with scale to foreground its subject matter, but features enough verisimilitude to provide recognizable context and wayfinding.', '6e63e320-da9e-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '1932', '', '', '', 'Lake Forest, IL, USA', '', '', '60de17787bfff10017a34128'),
	('60de11a97bfff10017a340b0', '60de11a97bfff10017a340b0', 826, 'Map and Plan for Lake Bluff', 14, 'This map appeared in The Lake Bluff Herald, a newspaper published by the Lake Bluff Camp Meeting Association (LBCMA) in the 1880s. â€œNow is the time to select your lot at Lake Bluff and build a cottage,â€ it urges, alongside a map of the planned religious summer recreation community, and above a lengthy list of names of those who had invested or purchased property.', '1bcb84f0-da9f-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '1884', '', '', '', 'Lake Bluff, IL, USA', '', '', '60de1783ebd2c30017d2aab6'),
	('60de16e6ebd2c30017d2aa79', '60de16e6ebd2c30017d2aa79', 827, 'Lake County Estate District of Country Homes, 1928', 14, 'This map captures Chicagoâ€™s northern suburbs at the culmination of the estate era, which entered its twilight period amidst the socioeconomic transformations of the 1930s, 1940s and 1950s. Featured are the many country places of Lake County along with the surrounding clubs and recreation sites that complemented them. ', '3b3f8db0-daa2-11eb-a664-6535e38e1747-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '1928', '', '', '', 'Lake Forest, IL, USA', '', '', '60de16e6ebd2c30017d2aa7c'),
	('60de1e91ebd2c30017d2aac6', '60de1e91ebd2c30017d2aac6', 828, 'Geraghtyâ€™s Map of Part of Lake County, 1916', 14, 'This map of the eastern part of Lake County doubles as an advertisement for John Griffith Real Estate. The bright red watermark makes no pretense to subtlety, emblazoning the name of the firm through the center of the region where it conducted so much business. ', 'cade3a80-daa6-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dde008ebd2c30017d2a78b', '23', '', '', '1916', '', '', '', 'Lake Forest, IL, USA', '', '', '60de1e91ebd2c30017d2aac9'),
	('60de1facebd2c30017d2aacb', '60de1facebd2c30017d2aacb', 829, 'Highway Classification map, 1949', 14, 'The hodgepodge system of roadways across the US was a challenge throughout much of the first half of the 1900s. Conditions of roads, some of which were little more than foot paths, could pose obstacles for early cars. ', '75286fb0-daa7-11eb-a664-6535e38e1747-2500.jpeg', '', '60dccebd65ade40017fdd5aa', '24', '', '', '1949', '', '', '', 'Lake Forest, IL, USA', '', '', '60de2053ebd2c30017d2aad1'),
	('60de20bd7bfff10017a34138', '60de20bd7bfff10017a34138', 830, 'Map Showing Fire Hydrants in Public Streets', 14, 'As the city expanded, infrastructure planning included building out water access lines for the fire department, as water towers were no longer sufficient for fire suppression. ', '1826a9c0-daa8-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dccebd65ade40017fdd5aa', '24', '', '', '1912', '', '', '', 'Lake Forest, IL, USA', '', '', '60de20bd7bfff10017a3413b'),
	('60de231aebd2c30017d2aaf1', '60de231aebd2c30017d2aaf1', 831, 'USGS Topographic Maps, 1920s', 14, '', '7f57a2b0-daa9-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dcdb2f80a7d50017122787', '25', '', '', '1918', '', '', '', 'Lake Forest, IL, USA', '', '', '60de231aebd2c30017d2aaf5'),
	('60de24577bfff10017a34154', '60de24577bfff10017a34154', 832, 'Village of Lake Bluff Zoning Map, 1956, updated to 1971', 14, '', '3a1b3850-daaa-11eb-a664-6535e38e1747-2500.jpeg', '', '60dccebd65ade40017fdd5aa', '24', '', '', '1956', '', '', '', 'Lake Bluff, IL, USA', '', '', '60de24577bfff10017a34157'),
	('60de27a97bfff10017a34179', '60de27a97bfff10017a34179', 833, 'Plat of Site for Post Office, Lake Forest, Ill., 1931', 14, 'This plat of survey was drawn up in 1931 as the City of Lake Forest considered a few possible sites for a new post office building. At the time, the Post Office was located in the northwest corner of Market Square. The land for the first-choice site was acquired just across Bank Lane in early 1932, and architects Ralph Milman and A.S. Morphett were selected to construct the new building, an exemplar of Art Deco architecture.', '37b4d4c0-daac-11eb-9965-a19a1dfb5ccb-2500.jpeg', '', '60dccebd65ade40017fdd5aa', '24', '', '', '1931', '', '', '', 'United States Postal Service, Northgate Street, Lake Forest, IL, USA', '', '', '60de27a97bfff10017a3417d'),
